    public static Text getText(Item item) {
        return MAP.get(item.toString());
    }

    public static void test2(ServerPlayerEntity player) {
        MutableText text = Text.empty();
        List<Item> list = ItemListUtil.getAllSurvivalItems();
        for (Item item : list) {
            text.append(((MutableText) getText(item)).setStyle(
                    Style.EMPTY.withHoverEvent(
                            new HoverEvent.ShowText(item.getName().copy())
                    )
            )).append(" ");
        }
        player.sendMessage(text);
    }
